import React from "react";
import App from "App.css"

function Card(props: any) {
  return (
    <dl className="dictionary">
      <div className="term">
        <dt>
          <span className="emoji" role="img" aria-label="Tense Biceps">
            {props.nome}
          </span>
          <p>{props.id}</p>
          <span>{props.descricao}</span>
        </dt>
        <dd>{props.preco}</dd>
      </div>
    </dl>
  );
}

export default Card;
